import 'frida-il2cpp-bridge';
export function start() {
    var Mod = {
        Menu: [],
        Name: 'nshm Mod',
        Icon: '',
        Menuinstance: false,
        callback: false,
        V: {
            xOffset: {name:'xOffset',value:60},
            yOffset: {name:'yOffset',value:0},
            onlyPick: {name:'只显示探索相关(暂时不全)',value:true},
            filterSome: {name:'只过滤部分物体',value:false},
            maxZ: {name:'最大距离',value:500},
        },
        Val(name) {
            return Mod.V[name].value;
        },
        Init: () => {
            try {
                if (typeof modmenu == 'undefined') {
                    console.log('创建悬浮窗出错,可能处于GadGet模式');
                    return false;
                }
                Mod.Menuinstance = modmenu.create(Mod.Name, Mod.Menu, {
                    onchange: function (result) {
                        result = JSON.parse(result);
                        Mod.callback(result);
                    }
                });
                Mod.Menuinstance.icon(Mod.Icon);
            }
            catch (e) {
                console.log('创建悬浮窗出错：' + e);
            }
        },
        Hook: () => {
            Il2Cpp.perform(() => {
                console.log('unity version:' + Il2Cpp.unityVersion);
                var GameRuntime = Il2Cpp.Domain.assembly('Game.Runtime').image;

                var dw = device.getScreenWidth();
                var dh = device.getScreenHeight();
                var players = [];
                var Canvas_Class = Java.use('android.graphics.Canvas');
                var Paint_Class = Java.use('android.graphics.Paint');
                var Paint_Style_Class = Java.use('android.graphics.Paint$Style');
                var Bitmap_Class = Java.use('android.graphics.Bitmap');
                var Bitmap_Config_Class = Java.use('android.graphics.Bitmap$Config');
                var worldCamera = false;
                var paint = Paint_Class.$new();
                var paint2 = Paint_Class.$new();
                paint.setStyle(Paint_Style_Class.STROKE.value);
                paint.setStrokeWidth(3);
                paint.setColor(colors.parseColor('#ffffff'));
                paint2.setColor(colors.parseColor('#ffffff'));
                paint2.setTextSize(26);
                var canvas1 = canvas.create({
                    ondraw: function () {
                        var bitmap = Bitmap_Class.createBitmap(dw, dh, Bitmap_Config_Class.ARGB_8888.value);
                        var canvast = Canvas_Class.$new(bitmap);
                        
                        for (var i = 0; i < players.length; i++) {
                            
                            canvast.drawRect(
                                players[i][0],
                                players[i][1],
                                players[i][0] + players[i][2],
                                players[i][1] + players[i][3],
                                paint
                            );
                            // canvast.drawLine(dw / 2, 0, players[i][0] + players[i][2] / 2, players[i][1], paint);
                            canvast.drawText((parseInt(players[i][5]) - 6).toString() + ' M', players[i][0], players[i][1] + 20, paint2);
                            canvast.drawText(players[i][6].toString(), players[i][0], players[i][1] + 50, paint2);
                        }
                        return bitmap;
                    }
                });

                canvas1.maxfps(30);

                GameRuntime.class('Pangu.Manager.CameraManager').method('CommonUpdate').implementation = function(){
                    this.method('CommonUpdate').invoke();
                    playerdata();
                }

                function playerdata() {
                    var newPlayers = [];

                    if(!worldCamera)worldCamera = GameRuntime.class('Pangu.Manager.CameraManager').method('get_worldCamera').invoke();

                    let keys = GameRuntime.class('Leihuo.RenderObject').field('s_AllRenderObject').value.method('get_Keys').invoke();
                    const keysEnumerator = keys.method('GetEnumerator').invoke().box();
                    while (keysEnumerator.method('MoveNext').invoke()) {
                        let obj = keysEnumerator.method('get_Current').invoke()
                        let name = obj.method('GetName').invoke().toString();

                        if(Mod.Val('filterSome') && (name == '""' || name.indexOf('MainPlayer') != -1 || name.indexOf('Npc_') != -1 || name.indexOf('Equip') != -1 || name.indexOf('OtherPlayer_') != -1 || name.indexOf('Pet_') != -1 || name.indexOf('_ske') != -1 || name.toLowerCase().indexOf('qiang') != -1 || name.toLowerCase().indexOf('shanzi') != -1 || name.toLowerCase().indexOf('.asset') != -1)){
                            continue;
                        }

                        if(Mod.Val('onlyPick') && (name.indexOf('Pick_') == -1 && name.indexOf('宝箱') == -1 && name.indexOf('客户端') == -1 && name.indexOf('奖励') == -1 && name.indexOf('吃球') == -1 && name.indexOf('画卷') == -1 && name.indexOf('Npc_土') == -1 && name.indexOf('Npc_狗') == -1)){
                            continue;
                        }

                        let p = worldCamera.method('WorldToScreenPoint').overload('UnityEngine.Vector3').invoke(obj.method('GetPosition').invoke());
                        if(p.field('z').value >= 0 && p.field('z').value <= Mod.Val('maxZ') && p.field('x').value >= -50 && p.field('y').value >= -50){
                            let h = worldCamera.method('WorldToScreenPoint').overload('UnityEngine.Vector3').invoke(obj.method('GetHeadPosition').invoke());
                            let f = worldCamera.method('WorldToScreenPoint').overload('UnityEngine.Vector3').invoke(obj.method('GetFootPosition').invoke());
                            var playerWidth = parseInt(h.field('x').value) - parseInt(f.field('x').value);
                            var playerHeight = parseInt(h.field('y').value) - parseInt(f.field('y').value);
                            if(playerHeight < 100) playerHeight = 100;
                            if(playerWidth < 100) playerWidth = 100;
                            var color = "#ffffff";
                            var player = [
                                p.field('x').value - Mod.Val('xOffset') - playerWidth,
                                dh - p.field('y').value - playerHeight - Mod.Val('yOffset'),
                                playerWidth,
                                playerHeight,
                                color,
                                p.field('z').value,
                                name
                            ];
                            newPlayers.push(player); 
                        }
                    }
                    keysEnumerator.method('Dispose').invoke();

                    players = newPlayers;
                }

                setInterval(function () {
                    dw = device.getScreenWidth();
                    dh = device.getScreenHeight();
                }, 1000);

                // setInterval(function () {
                //     playerdata();
                // }, 1000 / 25);
            });
        }
    };

    try {
        Mod.Icon = '';
        
        Mod.Menu = [
            {
                'id': 'read1',
                'type': 'webview',
                'data': '<p style="color: white;font-size: 12px;">本Mod还在开发测试中,功能主要用于地图探索。目前Mod可能会导致游戏比较卡顿</p>',
            },
            {
                'id': 'xOffset',
                'type': 'slider',
                'title': Mod.V.xOffset.name,
                'val': Mod.V.xOffset.value,
                'min': -150,
                'max': 150
            },
            {
                'id': 'yOffset',
                'type': 'slider',
                'title': Mod.V.yOffset.name,
                'val': Mod.V.yOffset.value,
                'min': -150,
                'max': 150
            },
            {
                'id': 'onlyPick',
                'type': 'switch',
                'title': Mod.V.onlyPick.name,
                'enable': Mod.V.onlyPick.value,
            },
            {
                'id': 'filterSome',
                'type': 'switch',
                'title': Mod.V.filterSome.name,
                'enable': Mod.V.filterSome.value,
            },
            {
                'id': 'maxZ',
                'type': 'input',
                'title': Mod.V.maxZ.name,
                'val': Mod.V.maxZ.value,
            }
        ];

        Mod.callback = (data) => {
            switch (data.id) {
                case 'xOffset':
                    Mod.V.xOffset.value = data.val;
                break;
                case 'yOffset':
                    Mod.V.yOffset.value = data.val;
                break;
                case 'onlyPick':
                    Mod.V.onlyPick.value = data.val;
                break;
                case 'filterSome':
                    Mod.V.filterSome.value = data.val;
                break;
                case 'maxZ':
                    Mod.V.maxZ.value = parseInt(data.val);
                break;
            }
        };
        
        Mod.Init();
    } catch (e) {
        console.log('设置Mod配置出错：' + e);
    }

    try {
        Mod.Hook();
    } catch (e) {
        console.log('Mod Hook出错：' + e);
    }
}